ncididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.','publish','open','closed','','mad-monks-on-the-road','','','2023-09-03 17:44:21','2023-09-03 17:44:21','',0,'http://monkmagazine.test/?post_type=product&#038;p=130',0,'product','',0),(131,1,'2023-09-03 17:43:00','2023-09-03 17:43:00','','mad-monks-on-the-road','','inherit','open','closed','','mad-monks-on-the-road','','','2023-09-03 17:43:00','2023-09-03 17:43:00','',130,'http://monkmagazine.test/app/uploads/2023/09/mad-monks-on-the-road.jpg',0,'attachment','image/jpeg',0),(132,0,'2023-09-03 18:02:19','2023-09-03 18:02:19','Buckle your seatbelts, put down your smartphones and pay attention to the off-ramps.  The Monks have a massive trove of wild, wacky, wonderful detours ahead.  Twelve solid years of mishaps started with our very first encounter along the roads of Northern California.  Landing in Paradise, California, before it burned, we found our way to the Abbey of New Clairvaux, a Trappist Monastery near Vina.  Days were spent at Deer Creek, watching the salmon slip through our fingers, while the hourly bells summoned a chance encounter with our first real Monk, Henry the Kindhearted.  You\'ll find many journeys of the heart, serendipitous encounters, and unexpected twists and turns in our search for the authentic soul of America. We promise never a dull moment.  Explore!','On The Road With The Monks','','publish','open','open','','on-the-road-with-the-monks','','','2023-09-03 18:02:19','2023-09-03 18:02:19','',0,'http://monkmagazine.test/?p=132',0,'post','',0),(142,2,'2023-09-03 19:14:04','2023-09-03 19:14:04','EPISODE 12 MAINE TEASER\r\n\r\nLobster pounds and crazed Canadians out sunning in the frigid fog abounded up the winding coastal highway. Everyone spoke French. On second notice, it wasn\'t French at all. It was Mainers speaking in a loud guttural bellow, leaning on their horns, anxious to pass our brakeless, sputtering, white trash hippie camper with \"I Brake For Dykes\" emblazoned across the back bumper.<span class=\"Apple-converted-space\"> </span>\r\n\r\nPulling over to let the tailgating stream of traffic pass (one of the few Good Sam precepts we do abide by), Jim parked adjacent to a dock where a heated brawl between a lobsterman and a lobster was well into round three. Next to Joe\'s Lobster Pound stood a short squat hunk flailing a lobster against the side of a wall trying to knock it loose, his forearm caught in the crusher claw of a good-size five pounder.<span class=\"Apple-converted-space\"> </span>\r\n\r\nThe lobster\'s claw furiously clung to flesh, as Joe violently shook his arm. His shirt was ripped and his pants were hanging on his hips, offering a good view of Maine cleavage.<span class=\"Apple-converted-space\"> </span>\r\n\r\nHe was tripping over his untied boots, dropping change, keys and wallet on the ground, spit drooling down his plump red cheeks. And with a fierce look in his bulging eyes, he wailed at the desperate crustacean, who obviously did not want to meet his maker in the mighty hot cauldron.<span class=\"Apple-converted-space\"> </span>\r\n\r\n\"Ayuh, the gawmy thing!\"<span class=\"Apple-converted-space\"> </span>\r\n\r\nSeveral out-of-towners stood back in horror, while a mother covered her son\'s eyes and ears, trying to pull her family back into their BMW. By now Joe\'s face was so red with rage he\'d taken a brick, smashed the bloody creature, and in one last desperate attempt, plunged the defenseless lobster into the scalding cauldron, sealing its fate forever.<span class=\"Apple-converted-space\"> </span>\r\n\r\n\"Ayuh, there she goes.\"<span class=\"Apple-converted-space\"> </span>\r\n\r\nJoe didn\'t feel a thing.<span class=\"Apple-converted-space\"> </span>\r\n\r\nNo, not a thing.<span class=\"Apple-converted-space\"> </span>\r\n\r\n<br><br>\r\n\r\n<a href=\"http://monkmagazine.ahservers.net/index.php/product/issue-twelve-queen-anne-is-maine/\">IF YOU ENJOYED THIS TEASER PURCHASE THE MAINE ISSUE HERE</a>','More Thrills 1','','publish','open','open','','more-thrills-1','','','2023-09-21 03:13:51','2023-09-21 03:13:51','',0,'http://monkmagazine.test/?p=142',0,'post','',0),(143,1,'2023-09-03 19:13:43','2023-09-03 19:13:43','','thrills-1','','inherit','open','closed','','thrills-1','','','2023-09-03 19:13:43','2023-09-03 19:13:43','',0,'http://monkmagazine.test/app/uploads/2023/09/thrills-1.jpg',0,'attachment','image/jpeg',0),(145,2,'2023-09-03 19:14:49','2023-09-03 19:14:49','EPISODE 18 NEVADA TEASER\r\n<br>\r\n<br>\r\nThe Monks cruised the hundred miles to Vegas under cloudy skies hoping to sneak in quietly before dawn. Coming over a hill, the orange, big-city glow slowly grew over the horizon. Finally, looking across a valley, Las Vegas literally popped into sight with a million watts of light arching across the desert floor like a march of fire ants spreading west.<span class=\"Apple-converted-space\"> </span>\r\n<br>\r\n<br>\r\nWith eyes smashed like grapes against the windshield The Monks exited down­town where they were momentarily bedazzled by the ten or so blocks of bright-as-­day casinos along dusty streets and broken pavement. Dolly Lama was at the window too, her pupils dilated to the point of pain from the high voltage light show popping off in a million directions at once. And then, just as quickly as it began, it stopped. The light and magic diminished to the point of nothingness. The adjacent neighborhood was as sad as any we\'d ever seen.<span class=\"Apple-converted-space\"> </span>\r\n<br>\r\n<br>\r\n“That was it? I thought Vegas was more than that.\" Mike felt disappointed.<span class=\"Apple-converted-space\"> </span>\r\n<br>\r\n<br>\r\n\"Do it again!\" yelled Jim.<span class=\"Apple-converted-space\"> </span>\r\n<br>\r\n<br>\r\nThe Monks were content to circle the blocks a few more times with whiplashed necks bent low over the dashboard arching up to look at the lights, the signs and the buffet offerings. Finally, after more than six times around, Mike turned south on Las Vegas Boulevard and headed into the dark when all at once more lights popped into view, towering high and far away.<span class=\"Apple-converted-space\"> </span>\r\n<br>\r\n<br>\r\nFurther south the volume of light began to pick up again. It was like entering a new time zone of a forever-daylight neon world.<span class=\"Apple-converted-space\"> </span>\r\n<br>\r\n<br>\r\nPassing Charleston Boulevard, The Monks now knew that compared to the paltry offering of glitz the downtown had so immediately surrendered, here, on The Strip, was the Mother Mary of neon glamour. Inflated, overstated, and completely bejeweled in its tackiest costumed splendor was the most white-trash-meets-bourgeois parody of America that had ever lit the skies.<span class=\"Apple-converted-space\"> </span>\r\n<br>\r\n<br>\r\n\"Out of control, out of control,\" Mike was mumbling over and over as he inched down the Boulevard at six in the morning in a bizarre traffic jam.<span class=\"Apple-converted-space\"> </span>\r\n<br>\r\n<br>\r\n<a href=\"http://monkmagazine.ahservers.net/index.php/product/issue-eighteen-planet-nevada/\">IF YOU ENJOYED THIS TEASER PURCHASE THE NEVADA ISSUE HERE</a>','More Thrills 2','','publish','open','open','','more-thrills-2','','','2023-09-21 03:17:25','2023-09-21 03:17:25','',0,'http://monkmagazine.test/?p=145',0,'post','',0),(146,1,'2023-09-03 19:14:37','2023-09-03 19:14:37','','thrills-2','','inherit','open','closed','','thrills-2','','','2023-09-03 19:14:37','2023-09-03 19:14:37','',0,'http://monkmagazine.test/app/uploads/2023/09/thrills-2.jpg',0,'attachment','image/jpeg',0),(148,2,'2023-09-03 19:15:28','2023-09-03 19:15:28','EPISODE 8 ARKANSAS TEASER\r\n<br>\r\n<br>\r\nGrandma Lane is known for far more than biscuits and gravy. As a matter of fact, she  doesn\'t do much cook\'n . She\'s content to subsist on toast in the morning, grilled cheese sandwiches for lunch and supper, and an occasional meal of fish and cooked broccoli with melted cheese. She doesn\'t know what kind of fish it is. She just knows she likes it. You see, mundane things like food and its preparation don\'t much interest Grandma anymore. Though there is one thing that does still interest her. And, in fact, interests most everybody born in these parts. And that\'s \"visit\'n.\"\r\n<br>\r\n<br>\r\nVisit\'n is short for visiting, and it\'s a national pastime around here. Those of us who come from the city sneak our visits in short bites, usually on the phone, at some restaurant, maybe in the car en route to an event. Here in the Ozarks there\'s no such pressing agenda. The only thing you must do is go to work and make an occasional appearance at the local Church of Christ.\r\n<br>\r\n<br>\r\nBut visit\'n? Now that\'s another matter. It\'s part and parcel of living in these hills. You can spot a local from a \"northerner\" by the degree of visit\'n in which they engage. A northerner, mind you, is anybody who wasn\'t born in the Ozarks, even if they\'ve lived here since they were three years old.\r\n<br>\r\n<br>\r\nNortherners are easy to spot. They are usually looking at their watches or preoccupying themselves with other things besides visit\'n. They\'ll invariably be in a hurry, talk fast, use your phone, pace the floor, light two cigarettes and leave early. They\'ll do anything to distract themselves from the undulating rhythms of visit\'n.\r\n<br>\r\n<br>\r\nWhat Northerners can\'t seem to get is that you\'ve got to ease into visit\'n. It\'s like entering a hot tub. You slide in like there is nothing else to do in the world. You\'ve got to sloooooowwww down. Slow way down.\r\n<br>\r\n<br>\r\n<a href=\"http://monkmagazine.ahservers.net/index.php/product/issue-eight-the-ozarks/\">IF YOU ENJOYED THIS TEASER PURCHASE THE ARKANSAS ISSUE HERE</a>','More Thrills 3','','publish','open','open','','more-thrills-3','','','2023-09-21 03:18:22','2023-09-21 03:18:22','',0,'http://monkmagazine.test/?p=148',0,'post','',0),(149,1,'2023-09-03 19:15:11','2023-09-03 19:15:11','','thrills-3','','inherit','open','closed','','thrills-3','','','2023-09-03 19:15:11','2023-09-03 19:15:11','',0,'http://monkmagazine.test/app/uploads/2023/09/thrills-3.jpg',0,'attachment','image/jpeg',0),(153,0,'2023-09-09 04:26:11','2023-09-09 04:26:11','','woocommerce-placeholder','','inherit','open','closed','','woocommerce-placeholder','','','2023-09-09 04:26:11','2023-09-09 04:26:11','',0,'http://monkmagazine.test/app/uploads/2023/09/woocommerce-placeholder.png',0,'attachment','image/png',0),(154,1,'2023-09-09 04:26:15','2023-09-09 04:26:15','<!-- wp:group {\"layout\":{\"inherit\":true,\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group\"><!-- wp:shortcode -->\n[woocommerce_cart]\n<!-- /wp:shortcode --></div>\n<!-- /wp:group -->','','','publish','closed','closed','','cart','','','2023-09-24 22:31:52','2023-09-24 22:31:52','',0,'http://monkmagazine.test/index.php/2023/09/09/cart/',0,'wp_template','',0),(155,1,'2023-09-09 04:26:15','2023-09-09 04:26:15','<!-- wp:group {\"layout\":{\"inherit\":true,\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group\"><!-- wp:shortcode -->\n[woocommerce_checkout]\n<!-- /wp:shortcode --></div>\n<!-- /wp:group -->','','','publish','closed','closed','','checkout','','','2023-09-25 00:11:18','2023-09-25 00:11:18','',0,'http://monkmagazine.test/index.php/2023/09/09/checkout/',0,'wp_template','',0),(158,1,'2023-09-10 00:40:16','2023-09-10 00:40:16','<!-- wp:template-part {\"slug\":\"header\",\"theme\":\"monk-theme\"} /-->\n\n<!-- wp:group {\"layout\":{\"inherit\":true,\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group\"><!-- wp:woocommerce/breadcrumbs /-->\n\n<!-- wp:query-title {\"type\":\"archive\",\"showPrefix\":false,\"align\":\"wide\"} /-->\n\n<!-- wp:term-description {\"align\":\"wide\"} /-->\n\n<!-- wp:woocommerce/store-notices /-->\n\n<!-- wp:group {\"align\":\"wide\",\"layout\":{\"type\":\"fl