ecommendations on how to minimize impact.','{}','pending','woocommerce.com','2023-07-23 21:39:52',NULL,0,'plain','',0,0,'info'),(63,'square_payments_q3_2023','marketing','en_US','Square for WooCommerce','Connect your Square account with WooCommerce to accept online and in-person payments (including contactless payments and cross-channel gift cards) quickly and securely. Save time by syncing sales, customers, and items and inventory — and manage everything through one centralized platform.','{}','pending','woocommerce.com','2023-07-23 21:39:52',NULL,0,'plain','',0,0,'info'),(64,'wcship-2023-07-hazmat-update-needed','update','en_US','Action required: USPS HAZMAT compliance update for WooCommerce Shipping & Tax extension','<strong>Your store requires an update for the WooCommerce Shipping extension</strong>. Please update to the latest version of the WooCommerce Shipping &amp; Tax extension immediately to ensure compliance with new USPS HAZMAT rules currently in effect.','{}','pending','woocommerce.com','2023-07-23 21:39:52',NULL,0,'plain','',0,0,'info'),(65,'wc-admin-choosing-a-theme','marketing','en_US','Choosing a theme?','Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.','{}','unactioned','woocommerce-admin','2023-07-25 04:21:06',NULL,0,'plain','',1,1,'info'),(66,'wc-admin-customizing-product-catalog','info','en_US','How to customize your product catalog','You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.','{}','unactioned','woocommerce-admin','2023-07-25 04:21:06',NULL,0,'plain','',1,1,'info'),(67,'wc-admin-mobile-app','info','en_US','Install Woo mobile app','Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics — wherever you are.','{}','unactioned','woocommerce-admin','2023-07-25 21:55:57',NULL,0,'plain','',1,1,'info'),(69,'wc-admin-onboarding-payments-reminder','info','en_US','Start accepting payments on your store!','Take payments with the provider that’s right for you - choose from 100+ payment gateways for WooCommerce.','{}','unactioned','woocommerce-admin','2023-07-29 22:57:46',NULL,0,'plain','',1,1,'info'),(70,'wc-admin-woopayments-rebrand','marketing','en_US','WooCommerce Payments is now WooPayments','We’ve changed the name as part of recent updates to the Woo brand. You’ll still enjoy the same seamless payments experience — just look for WooPayments in your WordPress admin.','{}','pending','woocommerce.com','2023-07-29 22:57:47',NULL,0,'plain','',0,0,'info'),(71,'wc-admin-woocommerce-payments','marketing','en_US','Try the new way to get paid','Securely accept credit and debit cards on your site. Manage transactions without leaving your WordPress dashboard. Only with <strong>WooPayments</strong>.<br><br>By clicking \"Get started\", you agree to our <a href=\"https://wordpress.com/tos/\" target=\"_blank\">Terms of Service</a>','{}','unactioned','woocommerce-admin','2023-07-30 21:39:52',NULL,0,'plain','',1,1,'info'),(72,'woocommerce-WCStripe-Aug-2023-update-needed','update','en_US','Action required: Security update for WooCommerce Stripe plugin','<strong>Your shop requires an important security update for the  WooCommerce Stripe plugin</strong>. The fix for this vulnerability was released on July 31. Please update immediately.','{}','pending','woocommerce.com','2023-08-05 17:28:00',NULL,0,'plain','',0,0,'info'),(73,'woocommerce-WCStripe-Aug-2023-security-updated','update','en_US','Security update of WooCommerce Stripe plugin','<strong>Your store has been updated to the latest secure version of the WooCommerce Stripe plugin</strong>. This update was released on July 31.','{}','pending','woocommerce.com','2023-08-05 17:28:00',NULL,0,'plain','',0,0,'info'),(74,'woocommerce-WooPayments-Aug-2023-update-needed','update','en_US','Action required: Security update for WooPayments (WooCommerce Payments) plugin','<strong>Your shop requires an important security update for the WooPayments (WooCommerce Payments) extension</strong>. The fix for this vulnerability was released on July 31. Please update immediately.','{}','pending','woocommerce.com','2023-08-05 17:28:00',NULL,0,'plain','',0,0,'info'),(75,'woocommerce-WooPayments-Aug-2023-security-updated','update','en_US','Security update of WooPayments (WooCommerce Payments) plugin','<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.','{}','pending','woocommerce.com','2023-08-05 17:28:00',NULL,0,'plain','',0,0,'info'),(76,'tiktok-apac-webinar-2023','marketing','en_US','Unlocking TikTok: Live Webinar August 9','Join us on August 9 for a free online masterclass with our partners at TikTok, tailored to Woo merchants in the APAC region (11 am AEST). You’ll learn how to connect your store to TikTok, unlock expert advertising tools, and reach its one billion active global users — all from the comfort of your own home.','{}','pending','woocommerce.com','2023-08-05 17:28:00',NULL,0,'plain','',0,0,'info'),(77,'avalara_q3-2023_noAvaTax','marketing','en_US','Automatically calculate VAT in real time','Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTax— including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.','{}','pending','woocommerce.com','2023-08-11 01:24:53',NULL,0,'plain','',0,0,'info'),(78,'google_uxstudy_recruitment_q3-2023','marketing','en_US','Share your feedback in exchange for $150','Woo has teamed up with Google to collect feedback on advertising products and services available to you. If selected, you’ll receive an incentive equal to $150 USD for a 60-minute interview that can help improve the products you use to advertise. If interested, please take 2 minutes to complete the screening survey.','{}','pending','woocommerce.com','2023-08-11 01:24:53',NULL,0,'plain','',0,0,'info'),(79,'woo-activation-survey-blockers-22AUG23','info','en_US','How can we help you get that first sale?','Your feedback is vital. Please take a minute to share your experience of setting up your new store and whether anything is preventing you from making those first few sales. Together, we can make Woo even better!','{}','pending','woocommerce.com','2023-09-02 02:16:47',NULL,0,'plain','',0,0,'info'),(80,'wc-admin-install-jp-and-wcs-plugins','info','en_US','Uh oh... There was a problem during the Jetpack and WooCommerce Shipping & Tax install. Please try again.','We noticed that there was a problem during the Jetpack and WooCommerce Shipping &amp; Tax install. Please try again and enjoy all the advantages of having the plugins connected to your store! Sorry for the inconvenience. The \"Jetpack\" and \"WooCommerce Shipping &amp; Tax\" plugins will be installed &amp; activated for free.','{}','unactioned','woocommerce-admin','2023-09-02 22:52:27',NULL,0,'plain','',1,1,'info'),(81,'wc-admin-launch-checklist','info','en_US','Ready to launch your store?','To make sure you never get that sinking \"what did I forget\" feeling, we\'ve put together the essential pre-launch checklist.','{}','unactioned','woocommerce-admin','2023-09-03 22:17:19',NULL,0,'plain','',0,1,'info'),(83,'tiktok_shopGTM_q3-2023_hasTikTok','marketing','en_US','You can now sell your products on TikTok Shop','TikTok is changing the way shoppers find and connect with brands. With TikTok Shop, you can sync your entire catalog from within Woo and sell directly to TikTok users through in-feed videos, livestreams, and your product showcase tab.','{}','pending','woocommerce.com','2023-09-07 02:11:15',NULL,0,'plain','',0,0,'info'),(84,'tiktok_shopGTM_q3-2023_noTikTok','marketing','en_US','You can now sell your products on TikTok Shop','TikTok is changing the way shoppers find and connect with brands. With TikTok Shop, you can sync your entire catalog from within Woo and sell directly to TikTok users through in-feed videos, livestreams, and your product showcase tab.','{}','pending','woocommerce.com','2023-09-08 04:57:27',NULL,0,'plain','',0,0,'info'),(85,'wc-admin-coupon-page-moved','update','en_US','Coupon management has moved!','Coupons can now be managed from Marketing &gt; Coupons. Click the button below to remove the legacy WooCommerce &gt; Coupons menu item.','{}','unactioned','woocommerce-admin','2023-09-09 19:12:11',NULL,0,'plain','',0,0,'info'),(86,'klaviyo_q3_2023','marketing','en_US','Build long lasting relationships with Klaviyo for WooCommerce','Increase customer engagement and boost conversions with powerful email and SMS automation from Klaviyo. Fully integrated with your Woo store, Klaviyo enables you to send personalized communications to your customers — ensuring that the right message is delivered at the right time for maximum impact.','{}','pending','woocommerce.com','2023-09-11 19:52:23',NULL,0,'plain','',0,0,'info'),(87,'wc-admin-payments-remind-me-later','info','en_US','Save big with WooPayments','Save up to $800 in fees by managing transactions with WooPayments. With WooPayments, you can securely accept major cards, Apple Pay, and payments in over 100 currencies.','{}','unactioned','woocommerce-admin','2023-09-12 19:46:11',NULL,0,'plain','',0,1,'info'),(88,'wc_admin_BNPL_WCPay_Q3_2023','marketing','en_US','Afterpay and Affirm have arrived in WooCommerce Payments!','Give your customers more power with buy now, pay later from Afterpay and Affirm — now included as part of WooCommerce Payments! With this new integration, you can quickly offer a checkout option that converts sales and boosts average order value, all from within the same payments dashboard you already know.','{}','pending','woocommerce.com','2023-09-18 22:08:44',NULL,0,'plain','',0,0,'info'),(89,'wc_admin_afterpay_WCPay_Q3_2023','marketing','en_US','Afterpay has arrived in WooCommerce Payments!','Give your customers more power with buy now, pay later from Afterpay — now included as part of WooCommerce Payments! With this new integration, you can quickly offer a checkout option that converts sales and boosts average order value, all from within the same payments dashboard you already know.','{}','pending','woocommerce.com','2023-09-18 22:08:44',NULL,0,'plain','',0,0,'info'),(90,'woocommerce-usermeta-Sept2023-productvendors','update','en_US','Your store requires a security update','<strong>Your shop needs an update to address a vulnerability in WooCommerce.</strong> The fix was released on Sept 15. Please update WooCommerce to the latest version immediately. <a href=\"https://developer.woocommerce.com/2023/09/16/woocommerce-vulnerability-reintroduced-from-7-0-1/\" />Read our developer update</a> for more information.','{}','pending','woocommerce.com','2023-09-20 21:07:52',NULL,0,'plain','',0,0,'info');
